import React from 'react';
import './header.css';
import { render } from 'react-dom';
import { Router, Route } from 'react-router';
import { BrowserRouter } from 'react-router-dom'





class Header extends React.Component {
    render() {
      return (

            <div>
              <Route path="/" />
              <Route path="/docs"  />
            </div>
      );
    }
}
export default Header;
